export default [
  {
    question:
      "Which one of the following is not a type of experimental method?",
    answers: [
      "Single group experiment",
      "Residual group experiment",
      "Parallel group experiment",
      "Rational group experiment",
    ],
    correct: 2,
  },

  {
    question: "Which one of the following is not a non parametric test ?",
    answers: ["t-test", "Sign test", "Chi-square test", "Run test"],
    correct: 1,
  },
  {
    question: "A workshop is ?",
    answers: [
      "a conference for discussion on a topic",
      "a meeting for discussion on a topic",
      "a class at a college or a university in which a teacher and the students discuss a topic",
      "a brief intensive courde for a small group emphasizing the development for a skill or technique for solving a specific problem",
    ],
    correct: 4,
  },
  {
    question: "A working hypothesis is ?",
    answers: [
      "A proven hypothesis for an argument",
      "not required to be tested",
      "a provisionally accepted hypothesis for further research",
      "a scientific theory",
    ],
    correct: 3,
  },
  {
    question:
      "Which of the following sampling methods is not based on probability?",
    answers: [
      "Simple Random Sampling",
      "Stratified Sampling",
      "Quota Sampling",
      "Cluster Sampling",
    ],
    correct: 3,
  },
  {
    question: "The Research that aims at immediate application is?",
    answers: [
      "Action Research",
      "Empirical Research",
      " Conceptual Research",
      "Fundamental Research",
    ],
    correct: 1,
  },
  {
    question: "Conferences are neant for ?",
    answers: [
      "Multiple target groups",
      "Group discussions",
      "Show-casing new Research",
      "All the above",
    ],
    correct: 4,
  },
];
